// SPDX-License-Identifier:GPL-3.0

pragma solidity ^0.8.17;

contract HelloWorld {
    // 定长数组基本使用
    function test() public pure returns(uint8[3] memory){
        // 创建一个固定长度数组
        uint8[3] memory array;
        // 通过索引赋值/修改
        array[0] = 0xff;
        array[1] = 0xaa;
        array[2] = 0xbb;

        // 通过length获取长度, 返回uint256, length只读
        uint256 len = array.length;

        // 需要注意的是, 不能通过length来修改数组长度
        // 也没有push方法

        return array;
    }

    // 数组字面量
    function test2() public pure returns (uint8[3] memory, bytes1[3] memory) {
        /**
            - 数组字面量是在方括号中（ [...] ） 包含一个或多个逗号分隔的表达式.
                比如: [1, 2, 3]
            - 他的长度固定, 不能修改, 但是内容可以修改
            - ***数组字面量的基本类型由数组的一个元素确定****
                [1, 2, 3]是一个uint[3]类型的数组字面量
                [1, -1]是无效的, 因为第一个元素是uint8, 所以整个数组的基本类型是uint8, 而第二个元素是int, 不能隐式转换
                如果希望表示一个int8类型的数组, 使用[int8(1), -1]
        */

        // 定义一个uint8[3]的数组字面量并赋值
        uint8[3] memory array = [1, 2, 3];

        // 定义一个bytes1[3]的数组字面量并赋值
        // bytes1[3] array2 = [0xff, 0xaa, 0xbb]; // 因为第一个元素0xff默认是uint8的, 所以整个字面量的类型为uint[3], 无法转换为bytes1[3]
        bytes1[3] memory array2 = [bytes1(0xff), 0xaa, 0xbb];

        return (array, array2);
    }

    // 二维定长数组
    function test3() public pure returns (bytes1[2][3] memory){
        // 定义了一个3,2类型的数组, 这里需要注意的是和其他语言是反的
        // 在java中定义一个3,2类型的是在是 int[3][2]
        bytes1[2][3] memory array;
        // 这里赋值和其他语言又是正的
        array[0][0] = 0xaa;
        array[0][1] = 0xbb;
        array[1][0] = 0xcc;
        array[1][1] = 0xdd;
        array[2][0] = 0xee;
        array[2][1] = 0xff;
        return array;
    }
}

